import { createBroswerRouter, RouterProvider } from "react-router-dom";
import EditEventPage from "./pages/EditEventPage";
import {} from "./pages/";

const router = createBroswerRouter([{ path: "/", element: <EditEventPage /> }]);

function App() {
	return (
		<RouterProvider router={router}/>
	);
}

export default App;
